Create main.c with the following content: #include "unisockets.h"
#include <arpa/inet.h>
#include <netinet/in.h>
#include <stdio.h>
#include <stdlib.h>
#include <string.h>
#include <strings.h>
#include <sys/socket.h>
#include <sys/types.h>
#include <unistd.h> #define BACKLOG 5 #define RECEIVED_MESSAGE_BUFFER_LENGTH 1024
#define SENT_MESSAGE_PREFIX "You've sent: "
#define SENT_MESSAGE_BUFFER_LENGTH \ RECEIVED_MESSAGE_BUFFER_LENGTH + sizeof(SENT_MESSAGE_PREFIX) int main(int argc, char *argv[]) { // Flags parsing char *listen_host = "127.0.0.1"; int listen_port = 1234; int opt; while ((opt = getopt(argc, argv, "l:p:")) != -1) { switch (opt) { case 'l': listen_host = optarg; optind--; break; case 'p': listen_port = atoi(optarg); break; default: fprintf(stderr, "Usage: %s -l HOST -p PORT
", argv[0]); exit(EXIT_FAILURE); } } // Variables int server_sock; int client_sock; struct sockaddr_in server_address; struct sockaddr_in client_address; socklen_t server_socket_length = sizeof(struct sockaddr_in); size_t received_message_length; char received_message[RECEIVED_MESSAGE_BUFFER_LENGTH]; ssize_t sent_message_length; char sent_message[SENT_MESSAGE_BUFFER_LENGTH]; char client_address_readable[sizeof(client_address.sin_addr) + client_address.sin_port + 1]; char client_address_human_readable[INET_ADDRSTRLEN]; // Logging char server_address_readable[sizeof(listen_host) + sizeof(listen_port) + 1]; sprintf(server_address_readable, "%s:%d", listen_host, listen_port); memset(&server_address, 0, sizeof(server_address)); memset(&client_address, 0, sizeof(client_address)); // Create address server_address.sin_family = AF_INET; server_address.sin_port = htons(listen_port); if (inet_pton(AF_INET, listen_host, &server_address.sin_addr) == -1) { perror("[ERROR] Could not parse IP address:"); exit(EXIT_FAILURE); } // Create socket if ((server_sock = socket(AF_INET, SOCK_STREAM, 0)) == -1) { perror("[ERROR] Could not create socket:"); printf("[ERROR] Could not create socket %s
", server_address_readable); exit(EXIT_FAILURE); } // Bind if ((bind(server_sock, (struct sockaddr *)&server_address, server_socket_length)) == -1) { perror("[ERROR] Could not bind to socket:"); printf("[ERROR] Could not bind to socket %s
", server_address_readable); exit(EXIT_FAILURE); } // Listen if ((listen(server_sock, BACKLOG)) == -1) { perror("[ERROR] Could not listen on socket:"); printf("[ERROR] Could not listen on socket %s
", server_address_readable); exit(EXIT_FAILURE); } printf("[INFO] Listening on %s
", server_address_readable); // Accept loop while (1) { printf("[DEBUG] Accepting on %s
", server_address_readable); // Accept if ((client_sock = accept(server_sock, (struct sockaddr *)&client_address, &server_socket_length)) == -1) { perror("[ERROR] Could not accept, continuing:"); continue; } if (inet_pton(AF_INET, listen_host, &server_address.sin_addr) == -1) { perror("[ERROR] Could not parse IP address:"); continue; } inet_ntop(AF_INET, &client_address.sin_addr, client_address_human_readable, sizeof(client_address_human_readable)); sprintf(client_address_readable, "%s:%d", client_address_human_readable, client_address.sin_port); printf("[INFO] Accepted client %s
", client_address_readable); // Receive loop received_message_length = 1; while (received_message_length) { memset(&received_message, 0, RECEIVED_MESSAGE_BUFFER_LENGTH); memset(&sent_message, 0, SENT_MESSAGE_BUFFER_LENGTH); printf("[DEBUG] Waiting for client %s to send
", client_address_readable); // Receive received_message_length = recv(client_sock, &received_message, RECEIVED_MESSAGE_BUFFER_LENGTH, 0); if (received_message_length == -1) { perror("[ERROR] Could not receive from client:"); printf("[ERROR] Could not receive from client %s, dropping message
", client_address_readable); break; } if (received_message_length == 0) { break; } printf("[DEBUG] Received %zd bytes from %s
", received_message_length, client_address_readable); // Process sprintf((char *)&sent_message, "%s%s", SENT_MESSAGE_PREFIX, received_message); sent_message[SENT_MESSAGE_BUFFER_LENGTH - 1] = '\0'; // Send sent_message_length = send(client_sock, sent_message, SENT_MESSAGE_BUFFER_LENGTH, 0); if (sent_message_length == -1) { perror("[ERROR] Could not send to client:"); printf("[ERROR] Could not send to client %s, dropping message
", client_address_readable); break; } printf("[DEBUG] Sent %zd bytes to %s
", sent_message_length, client_address_readable); } printf("[INFO] Client %s disconnected
", client_address_readable); // Shutdown if ((shutdown(client_sock, SHUT_RDWR)) == -1) { perror("[ERROR] Could not shutdown socket:"); printf("[ERROR] Could not shutdown socket %s, stopping
", client_address_readable); break; }; } return 0;
} It is a very simple TCP server that listens to messages, prefixes them with You've sent: and sends them back to the sender. Now, copy and paste the unisockets.h header in the same directory as main.c.
